import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import Home from './home';
import Portfolio from './portfolio';
import Channels from './channels';


export default function App() {
  return (
    <Router>
        <Switch>
          <Route path="/portfolio">
            <Portfolio />
          </Route>
          <Route path="/channels">
            <Channels />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
    </Router>
  );
}

function About() {
  return Home;
}

function Stuff() {
  return Portfolio;
}

function Contact() {
  return Channels;
}
